import React from 'react';
import Header from './Header';

function NotFound() {
  return (
    <div>
      <h1>404 - Сторінку не знайдено</h1>
      <p>Вибачте, сторінка, яку ви шукаєте, не існує.</p>
    </div>
  );
};

export default NotFound;
